// auxiliary internal functions
inline double RN(const double m11,const double m22){
  return 1./(m11-m22);
}
inline double RS(const double m11,const double m22,const double m33){
  return (m11-m22)/(m11-m33);
}
inline double RS(const double m11,const double m22,const double m33,
		 const double m44,const double m55){
  return (m11-m22)*(m11-m33)/((m11-m44)*(m11-m55));
}
inline double RS(const double m11,const double m22,const double m33,
		 const double m44,const double m55,const double m66,
		 const double m77){
  return (m11-m22)*(m11-m33)*(m11-m44)/((m11-m55)*(m11-m66)*(m11-m77));
}
inline double RD(const double m11,const double m22,const double m33,
		 const double m44,const double m55,const double m66){
  return (m11-m22)*RS(m11,m33,m44,m55,m66);
}
inline double RD(const double m11,const double m22,const double m33,
		 const double m44){
  return (m11-m22)*RS(m11,m33,m44);
}
inline double RC(const double m11,const double m44,const double m66,
		 const double me2){
  return RS(m11,m44,me2)+RS(m11,m66,me2)-RS(m11,m44,m66,me2,me2);
}
inline double RC(const double m11,const double m44,const double m55,
		 const double m66,const double mp2,const double me2){
  return RS(m11,m44,m55,mp2,me2)+RS(m11,m44,m66,mp2,me2)
    +RS(m11,m55,m66,mp2,me2)-RS(m11,m44,m55,m66,mp2,me2,me2)
    -RS(m11,m44,m55,m66,mp2,mp2,me2);
}
