double mv2s2nf3p4V(const quarkmassnf mass, const double L){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: mv2s1nf3p4V probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];
  double me2 = (m44+2.*m66)/3.;
  double RD146e = RD(m11,m44,m66,me2);
  double RD346e = RD(m33,m44,m66,me2);
  double RS1463e = RS(m11,m44,m66,m33,me2);
  double RS3461e = RS(m33,m44,m66,m11,me2);
  double RSe6611 = RS(me2,m66,m66,m11,m11);
  double RSe6613 = RS(me2,m66,m66,m11,m33);
  double RSe6633 = RS(me2,m66,m66,m33,m33);
  //double mu2 = mu0*mu0;
  double M13p4x22V =
       + AbV(m11,L) * ( 1./18.*RD146e - 1./9.*m33*RS1463e - 2./9.*m11*
         RS1463e );

      M13p4x22V +=  + AbV(m33,L) * ( 1./18.*RD346e - 2./9.*m33*RS3461e
          - 1./9.*m11*RS3461e );

      M13p4x22V +=  + AbV(me2,L) * ( 2./9.*me2*RSe6613 - 1./9.*me2*
         RSe6633 - 1./9.*me2*RSe6611 + 2./9.*m33*RSe6613 + 1./9.*m33*
         RSe6633 + 2./9.*m11*RSe6613 + 1./9.*m11*RSe6611 );

  return M13p4x22V/pow(f0,2);
}

double mv2s2nf3p6V(const quarkmassnf mass, const Linf Liin, const double L){
  return mv2s2nf3p6LV(mass,Liin,L)+mv2s2nf3p6RV(mass,L);
}

