// 1 valence mass 3 sea mass *****************************************

double mv1s3nf3p4V(const quarkmassnf mass, const double L){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: mv2s3nf3p4V probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m55 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];
  double xb1 = (m44+m55+m66)/3.;
  double msqr = sqrt(xb1*xb1-(m44*m55+m44*m66+m55*m66)/3.);
  double mp2 = xb1-msqr; 
  double me2 = xb1+msqr;

  //double mu2 = mu0*mu0;
  double RD1456ep = RD(m11,m44,m55,m66,me2,mp2);
  double RC1456pe = RC(m11,m44,m55,m66,mp2,me2);  
  double RSe45611p = RS(me2,m44,m55,m66,m11,m11,mp2);
  double RSp45611e = RS(mp2,m44,m55,m66,m11,m11,me2);

  double M12p4x13V =
       + AbV(m11,L) * (  - 1./3.*m11*RC1456pe );

      M12p4x13V +=  + AbV(mp2,L) * (  - 1./3.*m11*RSp45611e );

      M12p4x13V +=  + AbV(me2,L) * (  - 1./3.*m11*RSe45611p );

      M12p4x13V +=  + BbV(m11,L) * (  - 1./3.*m11*RD1456ep );

  return M12p4x13V/pow(f0,2);
}

double mv1s3nf3p6V(const quarkmassnf mass, const Linf Liin, const double L){
  return mv1s3nf3p6LV(mass,Liin,L)+mv1s3nf3p6RV(mass,L);
}

