      M12p6x13LV +=  + BbV(me2,mp2,L) * (  - 16./9.*m11*m66*me2*L5r*
         RSp451e*RSe451p - 16./9.*m11*m66*me2*L4r*RSp561e*RSe561p - 16./
         9.*m11*m66*me2*L4r*RSp461e*RSe461p - 16./9.*m11*m66*me2*L4r*
         RSp451e*RSe451p + 32./9.*m11*pow(m66,2)*L8r*RSp451e*RSe451p + 
         32./9.*m11*pow(m66,2)*L7r*RSp451e*RSe451p + 32./9.*m11*pow(
         m66,2)*L6r*RSp451e*RSe451p - 16./9.*m11*m55*me2*L5r*RSp461e*
         RSe461p - 16./9.*m11*m55*me2*L4r*RSp561e*RSe561p - 16./9.*m11*
         m55*me2*L4r*RSp461e*RSe461p - 16./9.*m11*m55*me2*L4r*RSp451e*
         RSe451p + 32./9.*m11*m55*m66*L7r*RSp461e*RSe451p + 32./9.*m11*
         m55*m66*L7r*RSp451e*RSe461p + 32./9.*m11*m55*m66*L6r*RSp461e*
         RSe461p + 32./9.*m11*m55*m66*L6r*RSp451e*RSe451p + 32./9.*m11*
         pow(m55,2)*L8r*RSp461e*RSe461p + 32./9.*m11*pow(m55,2)*L7r*
         RSp461e*RSe461p + 32./9.*m11*pow(m55,2)*L6r*RSp461e*RSe461p - 
         16./9.*m11*m44*me2*L5r*RSp561e*RSe561p - 16./9.*m11*m44*me2*
         L4r*RSp561e*RSe561p - 16./9.*m11*m44*me2*L4r*RSp461e*RSe461p
          - 16./9.*m11*m44*me2*L4r*RSp451e*RSe451p );

      M12p6x13LV +=  + BbV(me2,mp2,L) * ( 32./9.*m11*m44*m66*L7r*
         RSp561e*RSe451p + 32./9.*m11*m44*m66*L7r*RSp451e*RSe561p + 32./
         9.*m11*m44*m66*L6r*RSp561e*RSe561p + 32./9.*m11*m44*m66*L6r*
         RSp451e*RSe451p + 32./9.*m11*m44*m55*L7r*RSp561e*RSe461p + 32./
         9.*m11*m44*m55*L7r*RSp461e*RSe561p + 32./9.*m11*m44*m55*L6r*
         RSp561e*RSe561p + 32./9.*m11*m44*m55*L6r*RSp461e*RSe461p + 32./
         9.*m11*pow(m44,2)*L8r*RSp561e*RSe561p + 32./9.*m11*pow(m44,2)*
         L7r*RSp561e*RSe561p + 32./9.*m11*pow(m44,2)*L6r*RSp561e*
         RSe561p );

      M12p6x13LV +=  + BbV(me2,L) * (  - 8./9.*m11*m66*me2*L5r*pow(
         RSe451p,2) - 8./9.*m11*m66*me2*L4r*pow(RSe561p,2) - 8./9.*m11*
         m66*me2*L4r*pow(RSe461p,2) - 8./9.*m11*m66*me2*L4r*pow(
         RSe451p,2) + 16./9.*m11*pow(m66,2)*L8r*pow(RSe451p,2) + 16./9.
         *m11*pow(m66,2)*L7r*pow(RSe451p,2) + 16./9.*m11*pow(m66,2)*L6r
         *pow(RSe451p,2) - 8./9.*m11*m55*me2*L5r*pow(RSe461p,2) - 8./9.
         *m11*m55*me2*L4r*pow(RSe561p,2) - 8./9.*m11*m55*me2*L4r*pow(
         RSe461p,2) - 8./9.*m11*m55*me2*L4r*pow(RSe451p,2) + 32./9.*m11
         *m55*m66*L7r*RSe451p*RSe461p + 16./9.*m11*m55*m66*L6r*pow(
         RSe461p,2) + 16./9.*m11*m55*m66*L6r*pow(RSe451p,2) + 16./9.*
         m11*pow(m55,2)*L8r*pow(RSe461p,2) + 16./9.*m11*pow(m55,2)*L7r*
         pow(RSe461p,2) + 16./9.*m11*pow(m55,2)*L6r*pow(RSe461p,2) - 8./
         9.*m11*m44*me2*L5r*pow(RSe561p,2) - 8./9.*m11*m44*me2*L4r*pow(
         RSe561p,2) - 8./9.*m11*m44*me2*L4r*pow(RSe461p,2) - 8./9.*m11*
         m44*me2*L4r*pow(RSe451p,2) + 32./9.*m11*m44*m66*L7r*RSe451p*
         RSe561p );

