double mv2s3nf3p4V(const quarkmassnf mass, const double L){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 5) || (B0mq.size() != 5)){
    cout << "ERROR: mv2s3nf3p4R probably called with wrong number"
	 << "of quark masses\n";}
  // five masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m55 = 2.*B0mq[3];
  double m66 = 2.*B0mq[4];
  double xb1 = (m44+m55+m66)/3.;
  double msqr = sqrt(xb1*xb1-(m44*m55+m44*m66+m55*m66)/3.);
  double mp2 = xb1-msqr; 
  double me2 = xb1+msqr;
  //double mu2 = mu0*mu0;
  double RSe45611p = RS(me2,m44,m55,m66,m11,m11,mp2);
  double RSp45611e = RS(mp2,m44,m55,m66,m11,m11,me2);
  double RSe45613p = RS(me2,m44,m55,m66,m11,m33,mp2);
  double RSp45613e = RS(mp2,m44,m55,m66,m11,m33,me2);
  double RSe45633p = RS(me2,m44,m55,m66,m33,m33,mp2);
  double RSp45633e = RS(mp2,m44,m55,m66,m33,m33,me2);
  double RS14563pe = RS(m11,m44,m55,m66,m33,mp2,me2);
  double RS34561pe = RS(m33,m44,m55,m66,m11,mp2,me2);

  double RD1456ep = RD(m11,m44,m55,m66,me2,mp2);
  double RD3456ep = RD(m33,m44,m55,m66,me2,mp2);

  double M13p4x23V =
       + AbV(m11,L) * ( 1./18.*RD1456ep - 1./9.*m33*RS14563pe - 2./9.*
         m11*RS14563pe );

      M13p4x23V +=  + AbV(m33,L) * ( 1./18.*RD3456ep - 2./9.*m33*
         RS34561pe - 1./9.*m11*RS34561pe );

      M13p4x23V +=  + AbV(mp2,L) * (  - 1./9.*mp2*RSp45613e + 1./18.*
         mp2*RSp45633e + 1./18.*mp2*RSp45611e - 1./9.*m33*RSp45613e - 1.
         /18.*m33*RSp45633e - 1./9.*m11*RSp45613e - 1./18.*m11*
         RSp45611e );

      M13p4x23V +=  + AbV(me2,L) * (  - 1./9.*me2*RSe45613p + 1./18.*
         me2*RSe45633p + 1./18.*me2*RSe45611p - 1./9.*m33*RSe45613p - 1.
         /18.*m33*RSe45633p - 1./9.*m11*RSe45613p - 1./18.*m11*
         RSe45611p );

  return M13p4x23V/pow(f0,2);
}

double mv2s3nf3p6V(const quarkmassnf mass, const Linf Liin, const double L){
  return mv2s3nf3p6LV(mass,Liin,L)+mv2s3nf3p6RV(mass,L);
}

