double fv2s1nf3p4V(const quarkmassnf mass, const double L){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 3) || (B0mq.size() != 3)){
    cout << "ERROR: fv1s1nf3p4V probably called with wrong number"
	 << "of quark masses\n";}
  // three masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m14 = (m11+m44)/2.;
  double m34 = (m33+m44)/2.;
  //double RN13 = RN(m11,m33);
  double RD14 = m11-m44;
  double RD34 = m33-m44;
  double RS143 = RS(m11,m44,m33);
  double RS341 = RS(m33,m44,m11);
  //double mu2 = mu0*mu0;
  double F13p4x21V =
       + AbV(m11,L) * (  - 1./12. + 1./6.*RS143 );

      F13p4x21V +=  + AbV(m14,L) * ( 3./4. );

      F13p4x21V +=  + AbV(m33,L) * (  - 1./12. + 1./6.*RS341 );

      F13p4x21V +=  + AbV(m34,L) * ( 3./4. );

      F13p4x21V +=  + BbV(m11,L) * (  - 1./12.*RD14 );

      F13p4x21V +=  + BbV(m33,L) * (  - 1./12.*RD34 );

  return F13p4x21V/pow(f0,2);
}

double fv2s1nf3p6V(const quarkmassnf mass, const Linf Liin, const double L){
  return fv2s1nf3p6LV(mass,Liin,L)+fv2s1nf3p6RV(mass,L);
}

