       + AbV(m11,L) * ( 4*L3r*RD146e + 4*L0r*RD146e - 4./3.*m11*L5r*
         RC146e + 4*m11*L3r*RC146e - 10*m11*L2r - 4*m11*L1r + 4*m11*L0r
         *RC146e );

