double fv2s2nf3p4V(const quarkmassnf mass, const double L){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: fv2s1nf3p4V probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];
  double me2 = (m44+2.*m66)/3.;

  double m14 = (m11+m44)/2;
  double m16 = (m11+m66)/2;
  double m34 = (m33+m44)/2;
  double m36 = (m33+m66)/2;

  double RC146e = RC(m11,m44,m66,me2);
  double RC346e = RC(m33,m44,m66,me2);
  double RD146e = RD(m11,m44,m66,me2);
  double RD346e = RD(m33,m44,m66,me2);
  double RS1463e = RS(m11,m44,m66,m33,me2);
  double RS3461e = RS(m33,m44,m66,m11,me2);
  double RSe6611 = RS(me2,m66,m66,m11,m11);
  double RSe6613 = RS(me2,m66,m66,m11,m33);
  double RSe6633 = RS(me2,m66,m66,m33,m33);
  //double mu2 = mu0*mu0;
  double F13p4x22V =
       + AbV(m11,L) * ( 1./6.*RS1463e - 1./12.*RC146e );

      F13p4x22V +=  + AbV(m14,L) * ( 1./2. );

      F13p4x22V +=  + AbV(m16,L) * ( 1./4. );

      F13p4x22V +=  + AbV(m33,L) * ( 1./6.*RS3461e - 1./12.*RC346e );

      F13p4x22V +=  + AbV(m34,L) * ( 1./2. );

      F13p4x22V +=  + AbV(m36,L) * ( 1./4. );

      F13p4x22V +=  + AbV(me2,L) * (  - 1./3.*RSe6613 + 1./6.*RSe6633
          + 1./6.*RSe6611 );

      F13p4x22V +=  + BbV(m11,L) * (  - 1./12.*RD146e );

      F13p4x22V +=  + BbV(m33,L) * (  - 1./12.*RD346e );

  return F13p4x22V/pow(f0,2);
}

double fv2s2nf3p6V(const quarkmassnf mass, const Linf Liin, const double L){
  return fv2s2nf3p6LV(mass,Liin,L)+fv2s2nf3p6RV(mass,L);
}

