double fv2s3nf3p4V(const quarkmassnf mass, const double L){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 5) || (B0mq.size() != 5)){
    cout << "ERROR: fv2s3nf3p4V probably called with wrong number"
	 << "of quark masses\n";}
  // five masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m55 = 2.*B0mq[3];
  double m66 = 2.*B0mq[4];
  double m14 = (m11+m44)/2;
  double m15 = (m11+m55)/2;
  double m16 = (m11+m66)/2;
  double m34 = (m33+m44)/2;
  double m35 = (m33+m55)/2;
  double m36 = (m33+m66)/2;

  double xb1 = (m44+m55+m66)/3.;
  double msqr = sqrt(xb1*xb1-(m44*m55+m44*m66+m55*m66)/3.);
  double mp2 = xb1-msqr; 
  double me2 = xb1+msqr;
  //double mu2 = mu0*mu0;
  double RSe45611p = RS(me2,m44,m55,m66,m11,m11,mp2);
  double RSp45611e = RS(mp2,m44,m55,m66,m11,m11,me2);
  double RSe45613p = RS(me2,m44,m55,m66,m11,m33,mp2);
  double RSp45613e = RS(mp2,m44,m55,m66,m11,m33,me2);
  double RSe45633p = RS(me2,m44,m55,m66,m33,m33,mp2);
  double RSp45633e = RS(mp2,m44,m55,m66,m33,m33,me2);
  double RS14563pe = RS(m11,m44,m55,m66,m33,mp2,me2);
  double RS34561pe = RS(m33,m44,m55,m66,m11,mp2,me2);

  double RC1456pe = RC(m11,m44,m55,m66,mp2,me2);
  double RC3456pe = RC(m33,m44,m55,m66,mp2,me2);
  double RD1456ep = RD(m11,m44,m55,m66,me2,mp2);
  double RD3456ep = RD(m33,m44,m55,m66,me2,mp2);

  double F13p4x23V =
       + AbV(m11,L) * ( 1./6.*RS14563pe - 1./12.*RC1456pe );

      F13p4x23V +=  + AbV(m14,L) * ( 1./4. );

      F13p4x23V +=  + AbV(m15,L) * ( 1./4. );

      F13p4x23V +=  + AbV(m16,L) * ( 1./4. );

      F13p4x23V +=  + AbV(m33,L) * ( 1./6.*RS34561pe - 1./12.*RC3456pe
          );

      F13p4x23V +=  + AbV(m34,L) * ( 1./4. );

      F13p4x23V +=  + AbV(m35,L) * ( 1./4. );

      F13p4x23V +=  + AbV(m36,L) * ( 1./4. );

      F13p4x23V +=  + AbV(mp2,L) * ( 1./6.*RSp45613e - 1./12.*RSp45633e
          - 1./12.*RSp45611e );

      F13p4x23V +=  + AbV(me2,L) * ( 1./6.*RSe45613p - 1./12.*RSe45633p
          - 1./12.*RSe45611p );

      F13p4x23V +=  + BbV(m11,L) * (  - 1./12.*RD1456ep );

      F13p4x23V +=  + BbV(m33,L) * (  - 1./12.*RD3456ep );

  return F13p4x23V/pow(f0,2);
}

double fv2s3nf3p6V(const quarkmassnf mass, const Linf Liin, const double L){
  return fv2s3nf3p6LV(mass,Liin,L)+fv2s3nf3p6RV(mass,L);
}

